/*Table structure for table `akta_cerai` */

DROP TABLE IF EXISTS `akta_cerai`;

CREATE TABLE `akta_cerai` (
  `akta_cerai_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_name` varchar(20) DEFAULT NULL,
  `kecamatan_id` varchar(7) DEFAULT NULL,
  `desa_id` varchar(10) DEFAULT NULL,
  `no_hp` varchar(20) DEFAULT NULL,
  `akta_cerai_status` enum('Dilihat','Belum Dilihat','Diproses','Selesai','Diterima','Dikembalikan','Diambil','Ditolak','Disetujui Penjemputan Pada Tanggal Sidang','Disetujui Penjemputan','Bersiaplah Petugas Menuju Ke Lokasi') NOT NULL DEFAULT 'Belum Dilihat',
  `akta_cerai_tanggal` date DEFAULT NULL,
  `jenis_layanan` enum('pendaftaran','persidangan','pengambilan produk pengadilan') DEFAULT NULL,
  `akta_cerai_klasifikasi` enum('Pemohon','Termohon','Penggugat','Tergugat','Pendaftaran Perkara','Persidangan','Cerai Gugat','Cerai Talak','Isbat Nikah','Harta Bersama','Kewarisan','Wali Adhol','Izin Poligami','Akta cerai','Salinan putusan') DEFAULT NULL,
  `akta_cerai_nomor` varchar(30) DEFAULT NULL,
  `akta_cerai_nama` varchar(150) DEFAULT NULL,
  `akta_cerai_jk` enum('Laki - Laki','Perempuan') DEFAULT NULL,
  `longitude` varchar(50) DEFAULT NULL,
  `akta_cerai_no_kk` varchar(30) DEFAULT NULL,
  `akta_cerai_alamat_lama` text DEFAULT NULL,
  `akta_cerai_alamat_baru` text DEFAULT NULL,
  `akta_cerai_file_akta` varchar(100) DEFAULT NULL,
  `akta_cerai_file_ktp` varchar(100) DEFAULT NULL,
  `akta_cerai_no_ktp` varchar(30) DEFAULT NULL,
  `akta_cerai_file_kk` varchar(100) DEFAULT NULL,
  `akta_cerai_form_perubahan` varchar(100) DEFAULT NULL,
  `akta_cerai_status_anak` enum('Ikut','Tidak Ikut') DEFAULT NULL,
  `akta_cerai_tanggal_proses` timestamp NULL DEFAULT NULL,
  `akta_cerai_tanggal_selesai` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `updated_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `keterangan` varchar(50) NOT NULL,
  PRIMARY KEY (`akta_cerai_id`),
  KEY `desa_id` (`desa_id`),
  KEY `kecamatan_id` (`kecamatan_id`),
  CONSTRAINT `akta_cerai_ibfk_1` FOREIGN KEY (`desa_id`) REFERENCES `desa` (`desa_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `akta_cerai_ibfk_2` FOREIGN KEY (`kecamatan_id`) REFERENCES `kecamatan` (`kecamatan_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=77 DEFAULT CHARSET=latin1;

